import React, {useState, useEffect} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import API from '../../services/api';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

function createData(name, id, pis, registration, option) {
  return { name, id, pis, registration, option };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function DadosListagem() {
  const classes = useStyles();

  const [usuarios, setUsuarios] = useState([]);

  useEffect(() => {
    async function loadData(){
      const response = await API.get('api/users');
      console.log(response.data);
      setUsuarios(response.data)
    }
    loadData();
  }, [])

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Nome do Colaborador</TableCell>
            <TableCell align="right">id</TableCell>
            <TableCell align="right">Pis</TableCell>
            <TableCell align="right">Matrícula</TableCell>
            <TableCell align="right">Opções</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {usuarios.map((row) => (
            <TableRow key={row._id}>
              <TableCell component="th" scope="row">
                {row.name_collaborator}
              </TableCell>
              <TableCell align="right">{row.id}</TableCell>
              <TableCell align="right">{row.pis}</TableCell>
              <TableCell align="right">{row.registration}</TableCell>
              <TableCell align="right">{row.option}</TableCell>
              <Button variant="outlined" color="primary">
              Primary
              </Button>
              <Button variant="outlined" color="secondary">
              Secondary
              </Button>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
